　OWNER/オーナー　メバル弾丸/たま　JH-83<br />■入り数：5本<br />★メバル専用の超細軸ジグヘッドです。ムチャクチャ刺さりがイイのはもちろんですがラインを通しやすいアイ形状や、水平スイミングを実現するバランス、凸出部分が少なく藻場でも根掛かりしにくい細身フォルム。折れば軽量化できる弾頭部。鈎のダメージを減らす必要最小限のスレッド製手巻きキーパーなど・・・。すべてがメバル専用機能。刺さりの「メバル弾丸」登場です。<style>
