　OWNER/オーナー　メバル流弾丸/ながれだま　JH-85<br />
■入り数：5本<br />
★メバルゲームのニューコンセプトジグヘッド！独自のヘッド形状は潮流を受けて確実に潮目を手元に伝えます。2つのラインアイを搭載し、フロントアイに結束しリトーブすると、表層へ浮き上がり、上ずったメバルを確実に捕らえます。メインアイに結束した場合は、ヘッドが潮を受け、浮き上がりを抑え攻めたいレンジを確実にキープできます。1つのジグヘッドで状況に応じた攻略が可能です。<style>
